import React from 'react';

function Aptitude() {
    return (
        <div className="skills">
            <h2>Compétences</h2>
                <ul>
                    <li>Créativité</li>
                    <li>La passion</li>
                    <li>L'esprit d'équipe</li>
                </ul>
        </div>
    );
}

export default Aptitude;
